  const [on, setOn] = useState(false);

  const Addtion = () => {
    setCount(count + 1);
  };
  const subst = () => {
    setCount(count - 1);
  };
  const handlechange = (e) => {
    setText(e.target.value);
  };

  const togleCLick = (e) => {
    setOn(!on);
  };
