    <div>
      <button onClick={Addtion}>addd</button>
      <p>{count}</p>
      <button onClick={subst}>substract</button>
      <input type="text" value={text} onChange={handlechange} />
      <p>{text}</p>

      <button onClick={togleCLick}>{On}</button>
    </div>
  );
};

export default DemoUsest;
